const App = () => {

  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <h1>{course}</h1>
      <p>
        {part1} {exercises1}
      </p>
      <p>
        {part2} {exercises2}
      </p>
      <p>
        {part3} {exercises3}
      </p>
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

const Header = () => {
  const course = 'Half Stack application development'
  return (
    <>
      <h1>{course}</h1>
    </>
  )
}

const Content = (props) => {  
    return(
      <>
        <p>props.first</p>
        <p>props.second</p>
        <p>props.third</p>
      </>
    )
}

const Total = (props) => {
  return(
    <>
      <p>Number of exercises {props + exercises2 + exercises3}</p>
    </>
  )
}


export default App
